import { useEffect } from 'react';

const Logout = () => {
    const handleLogout = () => {
        localStorage.removeItem('token');
        alert('Vous avez été déconnecté !');
        window.location.href = '/listEnchere';
    }
    useEffect(() => {
        handleLogout();
    }, []);

    return null;
};

export default Logout;
